Sensation White 2009 - Wicked Wonderland DVD

De DVD geeft een prachtig beeld van de 2 volledig uitverkochte avonden begin juli in de Arena met meer dan 90.000 bezoekers. De fantastische showbeelden, DJ's als Erick E, Fedde LeGrand en Sebastian Ingrosso, de megamix en vele special features nemen je mee terug naar het grootste Dance-event ter wereld; Sensation -Wicked Wonderland! Een uniek document om het evenement te ervaren of opnieuw te herleven. &lt;a href=&quot;
